  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginSignUp />} />
        <Route path="/otp" element={<OTP_UI />} />
        {/* Add other routes as needed */}
      </Routes>
    </Router>
  );
}

export default App;
